import React from "react";
import {Button ,TextField} from "@material-ui/core"
const GroceryItem = ({
  id,
  product_name,
  stock_available,
  quantity,
  price,
}) => {


  return (
    <div>
      <TextField> {product_name} </TextField>
      <Button>
        {stock_available ? "Stock Available" : "Stock Not Aavilable"}
      </Button>
      <h3>{quantity}</h3>
      <p>{price}</p>
    </div>
  );
};

export {GroceryItem}
